import React from 'react';

const TopNavBar = () => {
  return (
    <header className="w-full flex items-center justify-between bg-white px-6 pt-6 pb-2">
      <div className="flex flex-col">
        <span className="text-2xl font-semibold text-blue-700 border-b-2 border-blue-700 pb-1 w-fit">My Library</span>
      </div>
      <div className="flex items-center gap-6">
        {/* Notification Bell Icon */}
        <button className="text-gray-500 hover:text-blue-700" aria-label="Notifications">
          <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={2} stroke="currentColor" className="w-7 h-7">
            <path strokeLinecap="round" strokeLinejoin="round" d="M15 17h5l-1.405-1.405A2.032 2.032 0 0118 14.158V11a6.002 6.002 0 00-4-5.659V5a2 2 0 10-4 0v.341C7.67 6.165 6 8.388 6 11v3.159c0 .538-.214 1.055-.595 1.436L4 17h5m6 0v1a3 3 0 11-6 0v-1m6 0H9" />
          </svg>
        </button>
        {/* User Avatar Icon */}
        <div className="w-9 h-9 rounded-full bg-gray-200 flex items-center justify-center overflow-hidden">
          <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth={2} stroke="#1976d2" className="w-7 h-7">
            <path strokeLinecap="round" strokeLinejoin="round" d="M12 12c2.21 0 4-1.79 4-4s-1.79-4-4-4-4 1.79-4 4 1.79 4 4 4zm0 2c-2.67 0-8 1.34-8 4v2h16v-2c0-2.66-5.33-4-8-4z" />
          </svg>
        </div>
      </div>
    </header>
  );
};

export default TopNavBar;
